INSERT INTO post (description,picture,post_date,rating,admin_name,restaurant_id) VALUES ('Quán ăn có tuổi đời hơn 10 năm với thực đơn đa dạng từ các món cơm đến mì hủ tiếu bò né. Lần đầu mình ăn Út Hương lúc đó quán chỉ mới là một căn nhà nhỏ rộng chừng 3m không nổi bật gì so với những căn nhà bên cạnh. Nhưng sau 15 năm Út Hương nay đã mở rộng xung quanh ra thêm 4 căn nhà. Chỉ với như thế ta đã có thể tưởng tượng ra quán hút khách đến mức nào.Chất lượng món ăn ở Út Hương được bảo đảm rất tốt. Bạn kỳ vọng gì ở món ăn Út Hương đều đáp ứng được. Từ những hạt cơm được chiên tơi xốp vừa đủ những viên bò lúc lắc được xào vừa chín tới cho đến dĩa hủ tiếu xào với mùi cháy rất đặc trưng.Út Hương thật sự không có một món nào nổi bật tất cả các món đều có vị ngon riêng. Út Hương sẽ là một lựa chọn an toàn cho bạn trong lúc đang suy nghĩ cho bữa tối','null);','2023-04-21',8.0,'Binh',1);
